document.addEventListener("keydown", function onEvent(event) {
  if (event.key === " ") {
    event.preventDefault();
    flip();
  }
  else if (event.key === "s" || event.key === "S") {
    scramble();
  }
  else if(event.key === "Backspace" && realMemo == false){
    if([3,6,9,12,15,18].includes(memo.length)){
      memo=memo.slice(0,-2);
    }
    else{
      memo = memo.slice(0, -1);
    }
    document.querySelector("#memo").innerText="Memo: "+ memo;
  }
  else if(event.key === "Enter" && executionMode == false){
    checkMemo();
  }
  else{
  if (
    event.key.length === 1 &&
    (
      (event.key >= 'a' && event.key <= 'l') ||
      (event.key >= 'A' && event.key <= 'L') ||
      (event.key >= '0' && event.key <= '9') ||
       event.key === 'o' ||
       event.key === 'O'
    ) && executionMode==false){
      if(memo.length<20){
        memo+=event.key.toUpperCase();
      }
      if([2,5,8,11,14,17].includes(memo.length)){
        memo+=" ";
      }
      document.querySelector("#memo").innerText="Memo: "+ memo;
    }
  }
});

function formatScramble(num) {
  if (num < 0) {
    return Math.abs(num) + "-";
  } else {
    return num + "+";
  }
}

function flip() {
  if(side=='white'){
    side='black';
    dial='white';
  }
  else{
    side='white';
    dial='black'
  }
  for(let i of document.querySelectorAll(".circle")){
    i.style.backgroundColor = side;
  }
  for(let i of document.querySelectorAll(".dial")){
    i.style.backgroundColor = dial;
  }
  renderScramble();
}

