function changePinOrder(change) {
  //Tommy's
  let input = "dl R DR \\ UL L ur";

  if(change == true){
    input = prompt("enter pin order, for example: dl R DR \\ UL L ur");
  } else if(simultype == 'BPaul'){
    //BPaul's
    input = "dl R DR ur L UL \\";
  }

  simultypeInput = input;

  output = checkPinOrder(input)
  if(output != false){
    order = [output[0].split(" "),output[1].split(" "),output[2]];
    document.querySelector("#pinOrder").innerText = output[0]
    const items = output[0].split(' ');
    const container = document.getElementById('pairs');
    container.innerHTML = "Select which moves to memo:"
    for (const item of items) {
      const pins = document.createElement('input');
      pins.type = 'checkbox';
      //Tommy's
      if(input == "dl R DR \\ UL L ur") {
        switch (item) {
          case "dl": case "R": case "\\":   
            pins.checked = true;
            break;
          default:
            break;
        }
      }
      //BPaul's
      if(input == "dl R DR ur L UL \\") {
        switch (item) {
          case "dl": case "R": case "ur": case "L":  
            pins.checked = true;
            break;
          default:
            break;
        }
      }
      pins.value = item;
      pins.id = item;
      const label = document.createElement('label');
      label.htmlFor = item;
      label.innerText = item;
      container.appendChild(pins);
      container.appendChild(label);
    }

    if(pageJustLoaded !== true){
      switch (simultype) {
        case 'BPaul':
          alert("Pin order changed to BPaul!\nFlip type is set to y2");
          break;
        case 'Tommy':
          alert("Pin order changed to Tommy!\nFlip type is set to x2");
          break;   
        default:
          alert("Pin order changed to Custom!\nFlip type is set to x2");
          break;
      }
    } 
  }
  else{
    alert("That's not a pin order! Please try again.");
  }
  handleCreateMemo();
}
function checkPinOrder(input) {
  let sortedInput = input.split(" ").slice().sort();
  for(let i of pinOrders){
    let sortedOrder = i.split(" ").slice().sort();
    if(sortedOrder.every((element, index) => element === sortedInput[index])){
      document.querySelector("#udselect").innerHTML = ""
      if(sortedInput.includes("U")){
        document.querySelector("#udselect").innerHTML += 'execute the U move with your: <select id="umove"><option value="left">left hand</option><option value="right">right hand</option></select> '
      }
      if(sortedInput.includes("D")){
        document.querySelector("#udselect").innerHTML += 'execute the D move with your: <select id="dmove"><option value="left">left hand</option><option value="right">right hand</option></select>'
      }
      return [input,i,pinOrders.indexOf(i)];
    }
  }
  return false;
}

function checkMemo() {
  if(memo === ""){
    return;
  }

  let realMemo = "";
  for(let i of order[0]){
    if(document.getElementById(i).checked){
      let c=0;
      let c2=0;
      for(let z=0; z<14; z++){
        c+=random[z]*matrices[order[2]][order[1].indexOf(i)*2][z]
        c2+=random[z]*matrices[order[2]][order[1].indexOf(i)*2+1][z]
      }
      if(["ur","dr","UL","DL","L","\\"].includes(i) || (i=="U" && document.querySelector("#umove").value=="left") || (i=="D" && document.querySelector("#dmove").value=="left")){
        realMemo += l[(c+144)%12] + l[(c2+144)%12] + " ";
      }
      else{
        realMemo += l[(c2+144)%12] + l[(c+144)%12] + " ";
      }
    }
  }

  realMemo = convertToBPaulIfNeeded(realMemo);

  document.querySelector("#correctMemo").style.display="block";  
  if(memo==realMemo){
    document.querySelector("#correctMemo").style.color = "green";
    document.querySelector("#memo").style.color = "white";
    document.querySelector("#correctMemo").innerText ="Correct!"
  }
  else{
    document.querySelector("#correctMemo").style.color = "white";
    document.querySelector("#memo").style.color = "red";
    document.querySelector("#correctMemo").innerText=`Correct memo: ${realMemo}`;  
  }

  const isCorrect = (memo === realMemo);
  if(previousscrambletext !== scrambletext && !isPracticeMode()){
    addStatRow({
      timestamp: new Date().toLocaleString(),
      pinorder: simultype === "Custom" ? simultypeInput : simultype,
      time_seconds: document.querySelector("#timerButton").checked ? Number(seconds.toFixed(2)) : "",
      correct_memo: realMemo.trim(),
      input_memo: (memo || "").trim(),
      is_correct: isCorrect,
      scramble: scrambletext
    });
    renderInstantStats();
    previousscrambletext = scrambletext;
  }
  stopTimer();
}

function scrambleconvert(s) {
  let n = [12,12,12,12,12,12,12,12,12,12,12,12,12,12]
  for(let i of s.split("y2")[1].split(" ")){
    if(i.length==2){
    }
    else if(i.includes("ALL")){
      for (let index of [0,1,2,3,4,5,6,7,8]) {
        n[index] = eval("n[index]"+i.split("ALL")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("UL")){
      for (let index of [0,1,3,4]) {
        n[index] = eval("n[index]"+i.split("UL")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("UR")){
      for (let index of [1,2,4,5]) {
        n[index] = eval("n[index]"+i.split("UR")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("DL")){
      for (let index of [3,4,6,7]) {
        n[index] = eval("n[index]"+i.split("DL")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("DR")){
      for (let index of [4,5,7,8]) {
        n[index] = eval("n[index]"+i.split("DR")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("U")){
      for (let index of [0,1,2,3,4,5]) {
        n[index] = eval("n[index]"+i.split("U")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("L")){
      for (let index of [0,1,3,4,6,7]) {
        n[index] = eval("n[index]"+i.split("L")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("R")){
      for (let index of [1,2,4,5,7,8]) {
        n[index] = eval("n[index]"+i.split("R")[1].split("").reverse().join("")); 
      }      
    }
    else if(i.includes("D")){
      for (let index of [3,4,5,6,7,8]) {
        n[index] = eval("n[index]"+i.split("D")[1].split("").reverse().join("")); 
      }      
    }
  }
  for(let i of s.split("y2")[0].split(" ")){
    if(i.includes("ALL")){
      for (let index of [9,10,11,12,13]) {
        n[index] = eval("n[index]"+i.split("ALL")[1].split("").reverse().join("")); 
      }
      for (let index of [0,2,6,8]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("ALL")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("UL")){
      for (let index of [11,12,13]) {
        n[index] = eval("n[index]"+i.split("UL")[1].split("").reverse().join("")); 
      }
      for (let index of [2]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("UL")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("UR")){
      for (let index of [10,11,13]) {
        n[index] = eval("n[index]"+i.split("UR")[1].split("").reverse().join("")); 
      }
      for (let index of [0]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("UR")[1].split("").reverse().join("")); 
      }   
    }
    else if(i.includes("DL")){
      for (let index of [9,11,12]) {
        n[index] = eval("n[index]"+i.split("DL")[1].split("").reverse().join("")); 
      }
      for (let index of [8]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("DL")[1].split("").reverse().join("")); 
      } 
    }
    else if(i.includes("DR")){
      for (let index of [9,10,11]) {
        n[index] = eval("n[index]"+i.split("DR")[1].split("").reverse().join("")); 
      }
      for (let index of [6]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("DR")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("U")){
      for (let index of [10,11,12,13]) {
        n[index] = eval("n[index]"+i.split("U")[1].split("").reverse().join("")); 
      }
      for (let index of [0,2]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("U")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("L")){
      for (let index of [9,11,12,13]) {
        n[index] = eval("n[index]"+i.split("L")[1].split("").reverse().join("")); 
      }
      for (let index of [2,8]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("L")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("R")){
      for (let index of [9,10,11,13]) {
        n[index] = eval("n[index]"+i.split("R")[1].split("").reverse().join("")); 
      }
      for (let index of [0,6]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("R")[1].split("").reverse().join("")); 
      }
    }
    else if(i.includes("D")){
      for (let index of [9,10,11,12]) {
        n[index] = eval("n[index]"+i.split("D")[1].split("").reverse().join("")); 
      }
      for (let index of [6,8]) {
        n[index] = eval("n[index]"+i.replace("+","*").replace("-","+").replace("*","-").split("D")[1].split("").reverse().join("")); 
      }
    }
  }
  return n.map(num => (num+144) % 12);
}

function convertToBPaulIfNeeded(realMemo){
  if(simultype == 'BPaul'){
    realMemo = realMemo[1] + realMemo[0] + realMemo.slice(2);
    realMemo = realMemo.slice(0, 4) + realMemo.slice(5);
    realMemo = realMemo.slice(0, 8) + realMemo.slice(9);
    realMemo = realMemo.replace(/\s/g, "");
    realMemo = realMemo.match(/.{1,2}/g).join(" ");
    realMemo = realMemo + " ";
    return realMemo;
  }
  return realMemo;
}

function createMemo(random){
  let realMemo = "";
  for(let i of order[0]){
    if(document.getElementById(i).checked){
      let c=0;
      let c2=0;
      for(let z=0; z<14; z++){
        c+=random[z]*matrices[order[2]][order[1].indexOf(i)*2][z]
        c2+=random[z]*matrices[order[2]][order[1].indexOf(i)*2+1][z]
      }
      if(["ur","dr","UL","DL","L","\\"].includes(i) || (i=="U" && document.querySelector("#umove").value=="left") || (i=="D" && document.querySelector("#dmove").value=="left")){
        realMemo += l[(c+144)%12] + l[(c2+144)%12] + " ";
      }
      else{
        realMemo += l[(c2+144)%12] + l[(c+144)%12] + " ";
      }
    }
  }
  document.querySelector("#memo").innerText="Memo: " + convertToBPaulIfNeeded(realMemo);
}

