// All the code for the timer
let timerInterval;
let seconds = 0;
let startTime;
let isRunning = false;
function updateTimer() {
  const timer = document.querySelector("#timer");
  if (timer) {
    timer.innerText = seconds.toFixed(2);
  }
}
function startTimer() {
  if (!isRunning) {
    isRunning = true;
    startTime = performance.now();
    timerInterval = requestAnimationFrame(updateTimerFrame);
  }
}
function updateTimerFrame() {
  if (isRunning) {
    const elapsedTime = performance.now() - startTime;
    seconds = elapsedTime / 1000;

    // Cap to stop timer overflowing
    if (seconds >= 999) {
      seconds = 999.99;
      updateTimer();
      stopTimer();
      return;
    }

    updateTimer();
    timerInterval = requestAnimationFrame(updateTimerFrame);
  }
}
function stopTimer() {
  if (isRunning) {
    cancelAnimationFrame(timerInterval);
    isRunning = false;
  }
}
function resetTimer() {
  cancelAnimationFrame(timerInterval);
  isRunning = false;
  seconds = 0;
  updateTimer();
}
function restartTimer(){
  resetTimer();
  startTimer();
}

